import React, { useState } from 'react';
import { MapContainer, TileLayer, useMapEvents } from 'react-leaflet';
import 'leaflet/dist/leaflet.css';
import Header from './components/Header/Header';

import { searchNearbyAmenities } from './utils/searchNearbyAmenities';
import PlaceMarker from './components/PlaceMarker';

function ClickHandler({ onClick }) {
  useMapEvents({
    click(e) {
      onClick(e.latlng);
    },
  });
  return null;
}

export default function App() {
  const [center, setCenter] = useState({ lat: -37.8136, lng: 144.9631 });
  const [places, setPlaces] = useState([]);

  const handleMapClick = async ({ lat, lng }) => {
    setCenter({ lat, lng });
    const results = await searchNearbyAmenities({
      lat,
      lng,
      radius: 1000,
      amenities: ['restaurant', 'school', 'hospital'],
    });
    setPlaces(results);
  };

  return (
    <>
      <Header></Header>
      <MapContainer
        center={[center.lat, center.lng]}
        zoom={14}
        style={{ height: '100vh', width: '100%' }}
      >
        <TileLayer
          attribution="Â© OpenStreetMap contributors"
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
        />
        <ClickHandler onClick={handleMapClick} />
        {places.map(p => (
          <PlaceMarker key={p.id} lat={p.lat} lng={p.lng} name={p.name} />
        ))}
      </MapContainer>
    </>

  );
}
